import React from 'react';
import { Button, Flex, Heading, Input, useColorMode } from '@chakra-ui/react';

function LoginPage() {
    return (
            <Flex height="100vh" alignItems="center" justifyContent="center">
                <Flex direction="column" background="gray" p={12} rounded={6}>
                    <Heading mb={6}>Log in</Heading>
                    <Input type="text" placeholder="email" variant="filled" mb={3}></Input>
                    <Input type="password" placeholder="*********" variant="filled" mb={6}></Input>
                    <Button background="teal" colorScheme="teal">Log in</Button>
                </Flex>
            </Flex>
    )
}

export default LoginPage
